webpackJsonp([20100764705179],{461:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Keytool is a tool used to manage java keystores. It allows to do the following:</p>\n<ul>\n<li>listing keystore contens</li>\n<li>changing (add/remove) keys and certificates</li>\n<li>generating keys and key pairs</li>\n</ul>\n<p>Links:</p>\n<ul>\n<li><a href="https://blogs.oracle.com/java-platform-group/self-signed-certificates-for-a-known-community">Self signed certificates for a known community</a></li>\n</ul>\n<p>Help command is just:</p>\n<pre><code class="language-bash">keytool -h\n</code></pre>\n<p>Command to generate a key pair:</p>\n<pre><code class="language-bash">keytool -genkeypair -alias myalias -keyalg RSA -keysize 2048 -validity 730 -keystore ownjavakeystore.jks\n</code></pre>\n<p>Now to display the updated keystore content:</p>\n<pre><code class="language-bash">keytool -list -keystore ownjavakeystore.jks\n</code></pre>\n<p>Here is the command to export the myalias key pair into a certificate file called myalias.cer:</p>\n<pre><code class="language-bash">keytool -exportcert -keystore ownjavakeystore.jks -alias myalias -file myalias.cer\n</code></pre>',frontmatter:{title:"Keytool",date:"April 28, 2024",path:"/keytool",tags:["java","security","tls","ssl","keytool"],excerpt:""}}},pathContext:{prev:{html:'<p>A list of all tasks can be displayed with:</p>\n<pre><code class="language-zsh">gradle tasks\n</code></pre>\n<h3>Gradle init task:</h3>\n<p>This task initiates a project including a gradlew wrapper script:</p>\n<pre><code class="language-zsh">mkdir demo\ncd demo\ngradle init\ntree .\n</code></pre>\n<p>Application can be run with:</p>\n<pre><code class="language-zsh">./gradlew run\n</code></pre>\n<p>and bundled with:</p>\n<pre><code class="language-zsh">./gradlew build\n</code></pre>\n<p>This produces two archives called <code>app.tar</code> and <code>app.zip</code> in `<code></code>app/build/distribution<code></code></p>\n<h3>Gradle jar task: <a href="https://docs.gradle.org/current/samples/sample_building_kotlin_libraries.html#customize_the_library_jar">customizing the library jar</a></h3>\n<p>Properties to set if required in the build.gradle.kts file: version, name and group i.e. maven coordinates:</p>\n<pre><code class="language-kts">version=\nname=\ngroup=\n</code></pre>\n<p>Run the jar task:</p>\n<pre><code class="language-zsh">./gradlew jar\n</code></pre>\n<p>Verifying that an archive is valid:</p>\n<pre><code class="language-zsh">jar tf lib/build/libs/lib.jar\n</code></pre>\n<p>Verifying that archive is signed:</p>\n<pre><code class="language-zsh">jarsigner -verify lib/build/libs/lib.jar\n</code></pre>\n<h3>Displaying the tasks sequence</h3>\n<pre><code class="language-zsh">./gradlew test --console=plain\n</code></pre>\n<h3>The dependencies task</h3>\n<pre><code class="language-zsh">./gradlew :app:dependencies --configuration runtimeClasspath\n</code></pre>\n<p>This shows dependencies of a given classpath, e. g. runtime.</p>\n<h3>Generating sources JAR:</h3>\n<pre><code class="language-kts">java {\n    withSourcesJar()\n}\n</code></pre>\n<h3>Publishing</h3>\n<ul>\n<li><a href="https://docs.gradle.org/current/userguide/publishing_setup.html#sec:basic_publishing">Basic Publishing</a></li>\n<li><a href="https://docs.gradle.org/current/userguide/publishing_signing.html#publishing_maven:signing">Signing Artifacts</a></li>\n</ul>',id:"/home/nicolas/projects/workshop/src/pages/2022-09-09-gradle/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2022-09-09T14:02:00.438Z",path:"/gradle",title:"Gradle",excerpt:"",tags:["gradle","devops","continuous integration","build","java","kotlin"]}},next:{html:'<h4>Array to list</h4>\n<pre><code class="language-java">List&#x3C;Integer> list = Arrays.asList(10,20,30);\n</code></pre>\n<h4>Sort</h4>\n<pre><code class="language-java">int[] arr = new int[] { 10, 5, 4, 3, 32, 8 };\nArrays.sort(arr);\n</code></pre>\n<pre><code class="language-java">int[] arr = new int[] { 10, 5, 4, 3, 32, 8 };\nArrays.sort(arr, 3, arr.length - 1);\n</code></pre>\n<h4>Binary search</h4>\n<pre><code class="language-java">int[] arr = new int[] { 50, 40, 10, 90, 3, 89 };\nArrays.sort(arr);\n\nint key = 10;\nint index = Arrays.binarySearch(arr, key); // O(log N)\nSystem.out.println(key + " found at index " + index);\n\nint index2 = Arrays.binarySearch(arr, 3, 6, key);\n</code></pre>\n<h4>Initialization to given value instead or zeros</h4>\n<pre><code class="language-java">int[] arr = new int[10]:\nSystem.out.println(Arrays.toString(Arr));\nArrays.fill(arr, 5);\nSystem.out.println(Arrays.toString(Arr));\n</code></pre>\n<h4>Sorting using the Comparable interface</h4>\n<pre><code class="language-java">class Tuple implements Comparable&#x3C;Tuple> {\n    public int a, b;\n    public Tuple(int a, int b) {\n        this.a = a;\n        this.b = b;\n    }\n\n    @Override\n    public String toString() {\n        return "a=" + a + ", b=" + b;\n    }\n\n    @Override\n    public int compareTo(Tuple that) {\n        if (this.b != that.b) {\n            return this.b - that.b;\n        } else {\n            return this.a - that.a;\n        }\n    }\n}\n\npublic class Application {\n    public static void main(String[] args) {\n        Tuple[] arr = new Tuple[4];\n        arr[0] = new Tuple(10, 11);\n        arr[1] = new Tuple(20, 11);\n        arr[2] = new Tuple(100, 5);\n        arr[3] = new Tuple(5, 100);\n        Arrays.sort(arr);\n        for (int i = 0 ; i &#x3C; 4 ; i++) {\n            System.out.println(arr[i].toString());\n        }\n    }\n}\n</code></pre>\n<h4>Sorting using the Comparator class</h4>\n<pre><code class="language-java">Comparator&#x3C;Tuple> comparator = new Comparator&#x3C;Tuple>() {\n    @Override\n    public int compare(Tuple o1, Tuple o2) {\n        if (o1.b != o2.b) {\n            return o1.b - o2.b;\n        } else {\n            return o1.a - o2.a;\n        }\n    }\n}\n\nArrays.sort(arr, comparator);\n</code></pre>',id:"/home/nicolas/projects/workshop/src/pages/2025-11-10-java-arrays/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2025-11-10T23:44:00.000Z",path:"/java-arrays",title:"Java Arrays",excerpt:"",tags:["java","arrays"]}}}}}});
